import React, { Component } from "react";
import { StyleSheet, Text, View, Button, TextInput, Image } from "react-native";

export default class LumbarConditions extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <View>
        <Text>Lumbar Conditions Screen</Text>
      </View>
    );
  }
}
